import React from "react";
import Navigation from "../components/Navigation";

const Home = () => {
  const postData = () => {
    const init = {
      method: "GET", // Get =>Apporte moi données // POST (incremente donées), PUT (MAJ), DELETE (Supprimer données)
      headers: { "Content-Type": "application/json" },
      mode: "cors",
      cache: "default",
    };
    axios.get("http://localhost:8000/back/api", init).then((response) => {
      setDataStudent(response.data);
      console.log(response.data);
    });
  };

  return (
    <div>
      <Navigation />

      <h1>Ajout Eleve</h1>

      <form action="" className="form-create">
        <label for="name">Nom </label>
        <input id="name" type="text" placeholder="Entrez votre nom"></input>
        <label for="prenom">Nom </label>
        <input
          id="prenom"
          type="text"
          placeholder="Entrez votre prenom"
        ></input>
        <label for="age">Age</label>
        <input
          id="age"
          type="number"
          min="0"
          max="99"
          step="1"
          value="18"
        ></input>
        <label for="gender">Genre</label>
        <select id="gender">
          <option value="homme">Homme</option>
          <option value="femme">Femme</option>
        </select>
      </form>
      <button className="Validation" onClick={postData()}>
        Valider
      </button>
    </div>
  );
};

export default Home;
